import React, { Component } from 'react';
import PropTypes from 'prop-types';
import MerchiItem from './MerchiItem';


class Merchit extends Component {
  render() {
    return this.props.tapahtumat.map((tapahtuma) => (
      <MerchiItem 
      kategoria ={tapahtuma.kategoria} 
      nimi = {tapahtuma.nimi}
      hinta = {tapahtuma.hinta} 
      info = {tapahtuma.info}

      />
    ));
  }
}

// PropTypes
Tapahtumat.propTypes = {
  tapahtumat: PropTypes.array.isRequired
}

export default Merchit;
